import React from "react";
import contacts from "../contacts.jsx";
// import Contacts from "../contacts.jsx";
function Capp(props) {
  return (
   <div> 
    <div className="card">
      <div className="top"></div>
          <h2>{props.name}</h2>
          <img
            src={props.imgURL}
            alt="avatar_img"/>
      </div>

        <div className="bottom">
          <p>{props.phone}</p>
          <p>{props.email}</p>
        </div>
    </div>
  );
}

// var con =contacts;
for (var c=0; c< Object.keys({contacts}).length; c++){
  // var con= {contacts[c]};
  <Capp name="{contacts[c].name}" img="{contacts[c].imgURL}" phone= "{contacts[c].phone}" email= "{contacts[c].email}" />

};

/* <Capp {con[0]}/> */

export default Capp;
